var pos = 0;
var toggle = true;
var sky;

class Firework {
    constructor() {
        this.x = canvas.width / 2;
        this.y = canvas.height;
        this.rockets = [];
    }

    update() {
        if (ticks % 150 === 0)
            this.rockets.push(new Rocket(this));

        for (let i = 0; i < this.rockets.length; i++) {
            this.rockets[i].update();
            if (this.rockets[i].isDead) this.rockets.splice(i, 1);
        }
    }

    draw() {
        for (let i = 0; i < this.rockets.length; i++)
            this.rockets[i].draw();
    }
}

class Rocket {
    constructor(firework) {
        this.x = firework.x;
        this.y = firework.y;
        this.vx = rand(-10, 10);
        this.vy = toggle ? rand(-15, -23) : rand(-5, -14);
        toggle = !toggle;
        this.color = randColor(100, 255);
        this.isDead = false;
    }

    update() {
        this.x += this.vx;
        this.y += this.vy;

        this.vx *= 0.97;
        this.vy *= 0.97;

        if (Math.abs(this.vy) < 2) {
            fireObjs.push(new FireObject(this.x, this.y, arrays[pos]));
            pos++;
            if (pos === arrays.length) pos = 0;

            this.isDead = true;
        }
    }

    draw() {
        ctx.beginPath();
        ctx.fillStyle = this.color;
        ctx.rect(this.x, this.y, 5, 5);
        ctx.fill();
    }
}

class FireObject {
    constructor(x, y, arr) {
        this.x = x;
        this.y = y;
        this.arr = [];
        this.offset = 3;
        this.scale = 1;
        this.removeCount = 1;
        this.isDead = false;
        this.count = arr.length / 3;
        this.isFlashed = false;

        let exists = [];
        let v = 0;
        for (let i = 0; i < this.count; i++) {
            while (exists.indexOf(v) > -1) {
                v = Math.floor(rand(0, arr.length));
            }

            this.arr.push(arr[v]);
            exists.push(v);
        }
        sky.classList.toggle('flash', true);
    }

    update() {
        if (ticks % 10 === 0) {
            this.removeCount++;
        }

        if (ticks % 100 === 0 && !this.isFlashed) {
            sky.classList.toggle('flash', false);
            this.isFlashed = true;
        }

        this.arr.splice(Math.floor(Math.random() * this.arr.length), this.removeCount);

        if (ticks % 5 === 0) {
            //this.offset += 0.3;
            this.scale += 0.01;
        }

        if (this.arr.length < 1) {
            this.isDead = true;
        }
    }

    draw() {
        for (let i = 0; i < this.arr.length; i++) {
            ctx.beginPath();
            ctx.fillStyle = randColor(150, 255);
            let x = this.arr[i][0] + rand(-this.offset, this.offset);
            let y = this.arr[i][1] + rand(-this.offset, this.offset);
            ctx.rect(this.x + x * this.scale, this.y + y * this.scale, 3, 3);
            ctx.fill();
        }
    }
}

function randInt(min, max) {
    return Math.floor(rand(min, max));
}

function rand(min, max) {
    return Math.random() * (max - min) - (-min);
}

function randColor(min, max) {
    let k = randInt(0, 3);
    let r = k === 0 ? Math.floor(rand(min, max)) : Math.floor(rand(min, max)) / 3;
    let g = k === 1 ? Math.floor(rand(min, max)) : Math.floor(rand(min, max)) / 3;
    let b = k === 2 ? Math.floor(rand(min, max)) : Math.floor(rand(min, max)) / 3;
    return 'rgb('+r+','+g+','+b+')';
}

function tick() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    firework.update();
    firework.draw();

    for (let i = 0; i < fireObjs.length; i++) {
        fireObjs[i].update();
        fireObjs[i].draw();

        if (fireObjs[i].isDead) fireObjs.splice(i, 1);
    }

    ticks++;
    requestAnimationFrame(tick);
}

window.onload = function() {
    canvas = document.getElementById('canvas');
    canvas.width = document.body.clientWidth;
    ctx = canvas.getContext('2d');
    sky = document.querySelector('.sky');
    firework = new Firework();
    
    tick();
}